import React, { useEffect, useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  RefreshControl,
  TouchableOpacity,
  Alert,
} from 'react-native';
import { MaterialIcons as Icon } from '@expo/vector-icons';
import { adminAPI } from '../../config/api';
import Toast from 'react-native-toast-message';
import { formatCurrency, formatDate } from '../../utils/helpers';
import { showErrorToast, showSuccessToast } from '../../utils/errorHandler';

export default function AdminPaymentsScreen({ navigation }) {
  const [payments, setPayments] = useState([]);
  const [filter, setFilter] = useState('all'); // all, pending, verified
  const [refreshing, setRefreshing] = useState(false);

  useEffect(() => {
    loadData();
  }, [filter]);

  const loadData = async () => {
    try {
      const response = await adminAPI.getPayments(filter);
      // Handle response format - data might be nested
      const paymentsData = response.data?.data || response.data || [];
      setPayments(Array.isArray(paymentsData) ? paymentsData : []);
    } catch (error) {
      console.error('Error loading payments:', error);
      Toast.show({
        type: 'error',
        text1: 'Error',
        text2: error.response?.data?.message || 'Failed to load payments',
      });
    } finally {
      setRefreshing(false);
    }
  };

  const handleVerify = async (id) => {
    Alert.alert(
      'Verify Payment',
      'Are you sure you want to verify this payment?',
      [
        { text: 'Cancel', style: 'cancel' },
        {
          text: 'Verify',
          onPress: async () => {
            try {
              console.log('Verifying payment with ID:', id);
              const response = await adminAPI.verifyPayment(id);
              console.log('Verify payment response:', response.data);

              if (response.data?.success !== false) {
                Toast.show({
                  type: 'success',
                  text1: 'Success',
                  text2: response.data?.message || 'Payment verified successfully',
                  visibilityTime: 3000,
                });
                // Reload data to refresh the list
                await loadData();
              } else {
                Toast.show({
                  type: 'error',
                  text1: 'Error',
                  text2: response.data?.message || 'Failed to verify payment',
                  visibilityTime: 3000,
                });
              }
            } catch (error) {
              console.error('Error verifying payment:', error);
              Toast.show({
                type: 'error',
                text1: 'Error',
                text2: error.response?.data?.message || error.message || 'Failed to verify payment',
                visibilityTime: 3000,
              });
            }
          },
        },
      ]
    );
  };

  const filteredPayments = payments;

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()} style={styles.backButton}>
          <Icon name="arrow-back" size={24} color="#333" />
        </TouchableOpacity>
        <Text style={styles.headerTitle}>Payments</Text>
        <View style={styles.placeholder} />
      </View>

      <View style={styles.filters}>
        <TouchableOpacity
          style={[styles.filterButton, filter === 'all' && styles.filterButtonActive]}
          onPress={() => setFilter('all')}
        >
          <Text style={[styles.filterText, filter === 'all' && styles.filterTextActive]}>
            All
          </Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={[styles.filterButton, filter === 'pending' && styles.filterButtonActive]}
          onPress={() => setFilter('pending')}
        >
          <Text style={[styles.filterText, filter === 'pending' && styles.filterTextActive]}>
            Pending
          </Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={[styles.filterButton, filter === 'verified' && styles.filterButtonActive]}
          onPress={() => setFilter('verified')}
        >
          <Text style={[styles.filterText, filter === 'verified' && styles.filterTextActive]}>
            Verified
          </Text>
        </TouchableOpacity>
      </View>

      <ScrollView
        style={styles.content}
        refreshControl={<RefreshControl refreshing={refreshing} onRefresh={loadData} />}
      >
        <Text style={styles.countText}>
          {filteredPayments.length} payment{filteredPayments.length !== 1 ? 's' : ''}
        </Text>

        {filteredPayments.map((payment) => (
          <View key={payment.upipaymentid} style={styles.paymentCard}>
            <View style={styles.paymentHeader}>
              <View style={styles.paymentInfo}>
                <Text style={styles.paymentAmount}>{formatCurrency(payment.amount)}</Text>
                <Text style={styles.paymentMember}>
                  Member ID: {payment.memberid} â€¢ {payment.member_name || 'N/A'}
                </Text>
              </View>
              <View style={[
                styles.statusBadge,
                payment.status === 'Verified' ? styles.statusVerified : styles.statusPending
              ]}>
                <Text style={[
                  styles.statusText,
                  payment.status === 'Verified' ? styles.statusTextVerified : styles.statusTextPending
                ]}>
                  {payment.status || 'Pending'}
                </Text>
              </View>
            </View>

            <View style={styles.paymentDetails}>
              <View style={styles.detailRow}>
                <Icon name="receipt" size={16} color="#666" />
                <Text style={styles.detailLabel}>UPI Reference:</Text>
                <Text style={styles.detailValue}>{payment.upi_reference || 'N/A'}</Text>
              </View>
              {payment.transaction_id && (
                <View style={styles.detailRow}>
                  <Icon name="tag" size={16} color="#666" />
                  <Text style={styles.detailLabel}>Transaction ID:</Text>
                  <Text style={styles.detailValue} numberOfLines={1}>{payment.transaction_id}</Text>
                </View>
              )}
              <View style={styles.detailRow}>
                <Icon name="calendar-today" size={16} color="#666" />
                <Text style={styles.detailLabel}>Date:</Text>
                <Text style={styles.detailValue}>{formatDate(payment.created)}</Text>
              </View>
            </View>

            {payment.status === 'Pending' && (
              <TouchableOpacity
                style={styles.verifyButton}
                onPress={() => handleVerify(payment.upipaymentid)}
              >
                <Icon name="check-circle" size={20} color="#28a745" />
                <Text style={styles.verifyButtonText}>Verify Payment</Text>
              </TouchableOpacity>
            )}
          </View>
        ))}

        {filteredPayments.length === 0 && (
          <View style={styles.emptyState}>
            <Icon name="account-balance-wallet" size={64} color="#ccc" />
            <Text style={styles.emptyText}>No payments found</Text>
          </View>
        )}
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f5f5',
  },
  header: {
